<p>\u041F\u043E \u0443\u043C\u043E\u043B\u0447\u0430\u043D\u0438\u044E \u0437\u043D\u0430\u0447\u0435\u043D\u0438\u0435 \u0432\u044B\u0441\u0442\u0430\u0432\u043B\u0435\u043D\u043E \u0431\u0435\u0437 \u0443\u0447\u0435\u0442\u0430 \u0441\u043A\u0438\u0434\u043E\u043A \u0437\u0430 \u0440\u0435\u043F\u0443\u0442\u0430\u0446\u0438\u044E \u0438 \u0432\u0435\u0442\u0435\u0440\u0430\u043D\u0441\u043A\u0438\u0435 \u0440\u0430\u043D\u0433\u0438.</p>
