<p>\u0426\u0432\u0435\u0442\u043D\u044B\u043C\u0438 \u0441\u0442\u0440\u0435\u043B\u043A\u0430\u043C\u0438 \u043F\u043E\u0434 \u043F\u043E\u043B\u0437\u0443\u043D\u043A\u043E\u043C \u043E\u0442\u043C\u0435\u0447\u0435\u043D\u044B \u043E\u043F\u0442\u0438\u043C\u0430\u043B\u044C\u043D\u044B\u0435 \u0434\u043B\u044F \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u043D\u043E\u0433\u043E \u0440\u0435\u0441\u0443\u0440\u0441\u0430 \u0437\u043D\u0430\u0447\u0435\u043D\u0438\u044F \u0431\u0430\u043B\u0430\u043D\u0441\u0430:</p>
